import logo from './logo.svg';
import './App.css';
import Header from "./Pages/Header";
import Routes from "./Routes";
import signup from "./Pages/Signup"

function App() {
  return (
    <div>
      <Header />
      <Routes>
        <Route path="/signup" element={<Signup />} />
      </Routes>
    </div>
  );
}

export default App;
